Interprétation des labels et déclarations
Les labels et déclarations d'un questionnaire peuvent être au format :

string
VTL

Dans le cas où ils seraient sous forme de string, aucune configuration particulière n'est requise.
Dans le cas où ils seraient spécifiés en VTL, les props suivantes sont à valoriser :

features={['VTL']}
bindings={lunatic.getBindings(questionnaire)}

utils/init-questionnaire.html.body:
Initialisation d'un questionnaire
En présence de données de personnalisation, la fonction mergeQuestionnaireAndData permet d'insérer les données de personnalisation dans le questionnaire.
mergeQuestionnaireAndData(questionnaire)(data)
Arguments
questionnaire (object) : au format Lunatic-Model
data (object) :
{
    "COLLECTED": {
        "variable1": {
            "PREVIOUS": "Previous",
            "COLLECTED": "Collected",
            "FORCED": "Forced",
            "EDITED": "Edited",
            "INPUTED": "Inputed"
        },
        "variable2": {
            "COLLECTED": "Var 2"
        },
        ...
    },
    "EXTERNAL": {
        "ext": "External var",
        ...
    }
}

Retour
(object) : questionnaire au format Lunatic-Model
Exemple
questionnaire
{
    "components": [
        {
            "componentType": "Input",
            "response": {
                "name": "variable1",
                "valueState": [
                    { "valueType": "PREVIOUS", "value": null },
                    { "valueType": "COLLECTED", "value": null },
                    { "valueType": "FORCED", "value": null },
                    { "valueType": "EDITED", "value": null },
                    { "valueType": "INPUTED", "value": null }
                ]
            }
        }
    ],
    "variables": [
        { "variableType": "EXTERNAL", "name": "VAR_EXTERNAL", "value": null },
        {
            "variableType": "CALCULATED",
            "name": "VAR_CALCULATED",
            "expression": "VTL expression"
        }
    ]
}

